import Navbar from './Navbar';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Tasklist from './Tasklist';

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />
        <div className="content">
          <Tasklist />
          <Tasklist />
          <Tasklist />
        </div>
      </Router>
    </div>
  );
}

export default App;
